import React from "react";
import Card from "./Cards";
import Sdata from "./Sdata";


const App = () => (
  <>
  <h1 className="heading_style"> List Of Top 5 Netflix Series in 2020</h1>
   {Sdata.map((val) => {

    return (
      <Card 
         imgsrc={val.imgsrc}
         sname={val.sname}
         title={val.title}
         link={val.link} 
       />
    );

   })}
  </>

);

export default App;
